import React from "react";
import Jumbtron from "react-bootstrap/Jumbotron";

const JumboTron = () => {
  return (
    <JumboTron>
      <Container>
        <h1>&#40;React&#41; Google Books Search</h1>
        <p>Search for and save Books of Interest</p>
      </Container>
    </JumboTron>
  );
}

export default JumboTron;
